import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom'; // BƯỚC 1: Import Link từ react-router-dom
import api from '../services/api';
import UserForm from '../components/UserForm';
import UserDetailModal from '../components/UserDetailModal';


function UserListPage() {
    const [users, setUsers] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    const [isModalOpen, setIsModalOpen] = useState(false);
    const [currentUser, setCurrentUser] = useState(null);

    const [isViewModalOpen, setIsViewModalOpen] = useState(false);
    const [selectedUser, setSelectedUser] = useState(null);

    // ... (toàn bộ các hàm xử lý của bạn không cần thay đổi)
    useEffect(() => { /* ... */ });
    const fetchUsers = async () => { /* ... */ };
    const handleOpenCreateModal = () => { /* ... */ };
    const handleOpenEditModal = (user) => { /* ... */ };
    const handleViewDetail = (user) => { /* ... */ };
    const handleSaveUser = async (userData) => { /* ... */ };
    const handleDeactivateUser = async (user) => { /* ... */ };


    if (loading) return <div>Loading...</div>;
    if (error) return <div style={{color: 'red'}}>{error}</div>;

    return (
        <div>
            {/* ... (Phần tiêu đề và nút Add New User) ... */}
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }} className="mb-20">
                <h2>User Management</h2>
                <button onClick={handleOpenCreateModal}>
                    + Add New User
                </button>
            </div>
            
            <div className="table-wrapper">
                <table>
                  <thead>
                    <tr>
                        <th>Full Name</th>
                        <th>Email</th>
                        <th>Role</th>
                        <th>Status</th>
                        <th>Actions</th>
                    </tr>
                  </thead>
                  <tbody>
                    {users.map(user => (
                      <tr key={user.id}>
                          <td>
                              {/* BƯỚC 2: Bọc tên người dùng trong thẻ <Link> */}
                              <Link to={`/users/${user.id}`}>
                                  {user.full_name}
                              </Link>
                          </td>
                          <td>{user.email}</td>
                          <td style={{textTransform: 'capitalize'}}>{user.role}</td>
                          <td>
                              <span className={`status status-${user.is_active ? 'active' : 'inactive'}`}>
                                  {user.is_active ? 'Active' : 'Inactive'}
                              </span>
                          </td>
                          <td className="actions-cell">
                              {/* Nút "View" này mở popup xem nhanh */}
                              <button onClick={() => handleViewDetail(user)}>View</button>
                              <button className='edit' onClick={() => handleOpenEditModal(user)}>Edit</button>
                              {user.is_active && (
                                  <button className="danger" onClick={() => handleDeactivateUser(user)}>
                                      Deactivate
                                  </button>
                              )}
                          </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
            </div>
            
            <UserForm
                isOpen={isModalOpen}
                onClose={() => setIsModalOpen(false)}
                onSave={handleSaveUser}
                initialData={currentUser}
            />
            <UserDetailModal 
                isOpen={isViewModalOpen}
                onClose={() => setIsViewModalOpen(false)}
                user={selectedUser}
            />
        </div>
    );
}

// ... các hàm xử lý ...

export default UserListPage;
